import Navbar from "components/Navbar";

const Index = (props) => {
  return (
    <>
      <style jsx global>{`
        html,
        body {
          background-image: url("/indexmatty.jpg");
          background-position: center -200px;
          background-attachment: fixed;
          font-family: Cinzel;
        }

        * {
          box-sizing: border-box;
        }
      `}</style>
    </>
  );
};

export default Index;
